INSERT INTO `psp_answer` VALUES ('34', '2', '91', '可以,我的联想笔记本y460才刚装上,驱动难找也难装.不建议用,因为苹果有一个苹果专用键,快捷键一般笔记本都用不了,必须用苹果那个键盘上的专用键.所以其它电脑或者笔记本比如说:\nControl-F2到菜单Control-F3到Dock切换（Switch）Command-Tab在程序间切换Command-`在程序中的窗口间切换窗口（Window）Command-H隐藏Command-M最小化Command-N新建Command-O打开Command-P打印Command-Q退出Command-Q退出Command-W关闭\n而\"Control\"这个键是苹果电脑特有的\"苹果键\",而其它笔记本或者键盘是没有的,所以人家买苹果电脑是方便,我们装苹果系统是不便.我花了半天的时间装好了,但却不实用,复制 粘贴都只能点鼠标右键,操作很慢,另外给你个建议,AMD的CPU一般都装不上,要英特尔的CPU好装 E系列的,或者i3 i5 的\n补充：\n另外windows7 的装完32位的有14G左右, 64位的有17G左右,打上SP1的补丁,另外旗舰片的价格在168~210左右,其它版本不建议用,因为有很多功能没有,建议你去下一个\"国产\"的,山寨的功能也是一模一样的,破解的.不必花那些冤枉钱', '1', '2014-05-20 13:42:20', '2');
