INSERT INTO `psp_skill` VALUES ('1', '1', '47', 'Cvs 创建用户', '<div><span style=\"color: inherit;\">cvs 默认高级管理员为windows 高级管理员（我的是Administrator）。</span><br></div><div>在添加新用户时，首先用高级管理员登陆。步骤如下：</div><div>1. 打开Dos 窗口输入以一命令</div><div>set cvsroot=:pserver:Administrator@localhost:/servername</div><div>然后回车</div><div>（其中/servername 是在创建仓库时的name --&gt;我的是/mycvs 而</div><div>我的仓库目录是e:/course/java/mycvs，这里的/servername 是你填</div><div>写的name 而不是仓库目录）</div><div>2. 输入cvs login 命令然后回车</div><div>3. 输入Administrator 的密码然后回车</div><div>（我的是123456，完成后可以把Administrator 的密码设成别的或</div><div>者为空都不影响，这里必须输入密码，没设密码的先设置上，回头再</div><div>取消掉）</div><div>CVS 创建用户</div><div>第2 页共2 页</div><div>4. 输入cvs passwd -a bbb 然后回车</div><div>（添加用户bbb （操作系统中已经存在的用户，也可以是当前的用</div><div>户Administrator）</div><div>5. 输入新密码然后回车</div><div>（可以和操作系统中密码不一样。）</div><div>6. 再次输入密码然后回车</div><div>完成以上步骤后新用户就创建成功!</div>\n    ', '2014-05-14 01:48:41', '4.5', '5', '1');
INSERT INTO `psp_skill` VALUES ('2', '1', '47', 'svn服务器和客服端以及eclipse插件安装', '<div>1、svn服务器安装</div><div>安装 Setup-Subversion-1.6.15.msi，过程简单，略。</div><div><br></div><div>2、svn客服端</div><div>安装 TortoiseSVN-1.6.12.20536.msi，过程简单，略。</div><div><br></div><div>3、windows服务安装 （重要）</div><div>下载SVNService.exe</div><div>拷贝SVNService.exe到svn安装目录下bin目录里</div><div>在dos运行SVNService命令安装windows服务（path中有svn的bin目录直接执行命令，否则在dos中切换到svn安装的bin目录以来找的SVNService.exe程序）</div><div><br></div><div>安装时用 &nbsp;SVNService -install -d -r 你的svn资源库位置的父目录</div><div><br></div><div>更改时用 &nbsp;SVNService -setup -d -r 你的svn新的资源库位置的父目录</div><div><br></div><div>假如你的项目或者资源都要放到d:/java下，也就是你要在d:/java中创建资源库</div><div>SVNService -install -d -r d:/java</div><div>安装后就可以启动服务了，到windows里可以启动。</div><div><br></div><div>然后你就可以在d:/java 目录下创建文件夹（如 svn），然后用TortoiseSVN把这个文件夹创建成资源库（在svn文件上或进入svn文件夹内部右键--&gt;TortoiseSVN--&gt;create repository here）。</div><div>-----------------------------------</div><div>之后就是配置资源库了（访问权限）</div><div>资源库下</div><div>conf/svnserve.conf文件</div><div>[general]</div><div>#anon-access = none 定义匿名是否可以访问，none为不可以访问，也就是必须登录。如果=read 匿名可以读取，=write为可读写</div><div>anon-access = none</div><div>#auth-access = write 定义登录用户访问权限，=write为可读写</div><div>auth-access = write</div><div>#password-db = passwd指定用户定义文件为passwd</div><div>password-db = passwd</div><div>#authz-db = authz指定权限配置文件名authz</div><div>authz-db = authz</div><div><br></div><div>conf/passwd文件</div><div>用户名=密码</div><div><br></div><div>conf/authz</div><div>#用户名为passwd文件中定义的用户名</div><div>[groups]</div><div>组名=用户名</div><div><br></div><div>#svn这里就是d:/java下创建的资源库啦。</div><div># *=rw是所有用户可读写。可以根据需求调整配置。</div><div>[svn:/]</div><div>*=rw</div><div><br></div><div>现在用SVNService访问svn服务器了</div><div>直接用资源库文件夹名字就可以了、因为服务定位到了d:/java,然后就可以直接找的其下的svn资源库</div><div>url为：svn://ip/svn</div><div><br></div><div><br></div><div>4、eclipse 插件</div><div>解压 site-1.6.18.zip，把里面的features和plugins覆盖到eclipse安装目录下。也就是说把这两个文件夹中的jar包拷贝到eclipse同名的文件夹内。</div><div><br></div><div>---------------------------------------------------------</div><div>eclipse中使用svn</div><div>在菜单中 window--&gt;show view --&gt;svn--&gt;svn资源库</div><div><br></div><div>在svn资源库视图中右键 --&gt;新建--&gt;资源库位置&nbsp;</div>\n    ', '2014-05-14 03:04:35', '0.0', '1', '1');
INSERT INTO `psp_skill` VALUES ('3', '1', '44', 'eclipse快捷键大全', '<div>/* ---------------------------------------自理解----------------------------------------*/</div><div><br></div><div>ctrl+shift+T //查找当前工程下的某个类 &nbsp; 实时提示</div><div><br></div><div>ctrl+shift+R//查找当前工程下的某个文件 &nbsp; 实时提示</div><div><br></div><div>ctrl+/添加注释</div><div><br></div><div>/* ---------------------------------------自理解----------------------------------------*/</div><div><br></div><div>再给出常用eclipse 快捷键</div><div>Ctrl+1 快速修复(最经典的快捷键,就不用多说了)</div><div>Ctrl+D: 删除当前行 &nbsp;</div><div>Ctrl+Alt+↓ 复制当前行到下一行(复制增加)</div><div>Ctrl+Alt+↑ 复制当前行到上一行(复制增加)</div><div>Alt+↓ 当前行和下面一行交互位置(特别实用,可以省去先剪切,再粘贴了)</div><div>Alt+↑ 当前行和上面一行交互位置(同上)</div><div>Alt+← 前一个编辑的页面</div><div>Alt+→ 下一个编辑的页面(当然是针对上面那条来说了)</div><div>Alt+Enter 显示当前选择资源(工程,or 文件 or文件)的属性</div><div>Shift+Enter 在当前行的下一行插入空行(这时鼠标可以在当前行的任一位置,不一定是最后)</div><div>Shift+Ctrl+Enter 在当前行插入空行(原理同上条)</div><div>Ctrl+Q 定位到最后编辑的地方</div><div>Ctrl+L 定位在某行 (对于程序超过100的人就有福音了)</div><div>Ctrl+M 最大化当前的Edit或View (再按则反之)</div><div>Ctrl+/ 注释当前行,再按则取消注释</div><div>Ctrl+O 快速显示 OutLine</div><div>Ctrl+T 快速显示当前类的继承结构</div><div>Ctrl+W 关闭当前Editer</div><div>Ctrl+K 参照选中的Word快速定位到下一个</div><div>Ctrl+E 快速显示当前Editer的下拉列表(如果当前页面没有显示的用黑体表示)</div><div>Ctrl+/(小键盘) 折叠当前类中的所有代码</div><div>Ctrl+×(小键盘) 展开当前类中的所有代码</div><div>Ctrl+Space 代码助手完成一些代码的插入(但一般和输入法有冲突,可以修改输入法的热键,也可以暂用Alt+/来代替)</div><div>Ctrl+Shift+E 显示管理当前打开的所有的View的管理器(可以选择关闭,激活等操作)</div><div>Ctrl+J 正向增量查找(按下Ctrl+J后,你所输入的每个字母编辑器都提供快速匹配定位到某个单词,如果没有,则在stutes line中显示没有找到了,查一个单词时,特别实用,这个功能Idea两年前就有了)</div><div>Ctrl+Shift+J 反向增量查找(和上条相同,只不过是从后往前查)</div><div>Ctrl+Shift+F4 关闭所有打开的Editer</div><div>Ctrl+Shift+X 把当前选中的文本全部变味小写</div><div>Ctrl+Shift+Y 把当前选中的文本全部变为小写</div><div>Ctrl+Shift+F 格式化当前代码</div><div>Ctrl+Shift+P 定位到对于的匹配符(譬如{}) (从前面定位后面时,光标要在匹配符里面,后面到前面,则反之)</div><div><br></div><div>下面的快捷键是重构里面常用的,本人就自己喜欢且常用的整理一下(注:一般重构的快捷键都是Alt+Shift开头的了)</div><div>Alt+Shift+R 重命名 (是我自己最爱用的一个了,尤其是变量和类的Rename,比手工方法能节省很多劳动力)</div><div>Alt+Shift+M 抽取方法 (这是重构里面最常用的方法之一了,尤其是对一大堆泥团代码有用)</div><div>Alt+Shift+C 修改函数结构(比较实用,有N个函数调用了这个方法,修改一次搞定)</div><div>Alt+Shift+L 抽取本地变量( 可以直接把一些魔法数字和字符串抽取成一个变量,尤其是多处调用的时候)</div><div>Alt+Shift+F 把Class中的local变量变为field变量 (比较实用的功能)</div><div>Alt+Shift+I 合并变量(可能这样说有点不妥Inline)</div><div>Alt+Shift+V 移动函数和变量(不怎么常用)</div><div>Alt+Shift+Z 重构的后悔药(Undo)</div><div><br></div><div>编辑</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 查找并替换 Ctrl+F &nbsp;</div><div>文本编辑器 查找上一个 Ctrl+Shift+K &nbsp;</div><div>文本编辑器 查找下一个 Ctrl+K &nbsp;</div><div>全局 撤销 Ctrl+Z &nbsp;</div><div>全局 复制 Ctrl+C &nbsp;</div><div>全局 恢复上一个选择 Alt+Shift+↓ &nbsp;</div><div>全局 剪切 Ctrl+X &nbsp;</div><div>全局 快速修正 Ctrl1+1 &nbsp;</div><div>全局 内容辅助 Alt+/ &nbsp;</div><div>全局 全部选中 Ctrl+A &nbsp;</div><div>全局 删除 Delete &nbsp;</div><div>全局 上下文信息 Alt+？</div><div>Alt+Shift+?</div><div>Ctrl+Shift+Space &nbsp;</div><div>Java编辑器 显示工具提示描述 F2 &nbsp;</div><div>Java编辑器 选择封装元素 Alt+Shift+↑ &nbsp;</div><div>Java编辑器 选择上一个元素 Alt+Shift+← &nbsp;</div><div>Java编辑器 选择下一个元素 Alt+Shift+→ &nbsp;</div><div>文本编辑器 增量查找 Ctrl+J &nbsp;</div><div>文本编辑器 增量逆向查找 Ctrl+Shift+J &nbsp;</div><div>全局 粘贴 Ctrl+V &nbsp;</div><div>全局 重做 Ctrl+Y &nbsp;</div><div><br></div><div><br></div><div>查看</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 放大 Ctrl+= &nbsp;</div><div>全局 缩小 Ctrl+- &nbsp;</div><div><br></div><div><br></div><div>窗口</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 激活编辑器 F12 &nbsp;</div><div>全局 切换编辑器 Ctrl+Shift+W &nbsp;</div><div>全局 上一个编辑器 Ctrl+Shift+F6 &nbsp;</div><div>全局 上一个视图 Ctrl+Shift+F7 &nbsp;</div><div>全局 上一个透视图 Ctrl+Shift+F8 &nbsp;</div><div>全局 下一个编辑器 Ctrl+F6 &nbsp;</div><div>全局 下一个视图 Ctrl+F7 &nbsp;</div><div>全局 下一个透视图 Ctrl+F8 &nbsp;</div><div>文本编辑器 显示标尺上下文菜单 Ctrl+W &nbsp;</div><div>全局 显示视图菜单 Ctrl+F10 &nbsp;</div><div>全局 显示系统菜单 Alt+- &nbsp;</div><div><br></div><div><br></div><div>导航</div><div>作用域 功能 快捷键 &nbsp;</div><div>Java编辑器 打开结构 Ctrl+F3 &nbsp;</div><div>全局 打开类型 Ctrl+Shift+T &nbsp;</div><div>全局 打开类型层次结构 F4 &nbsp;</div><div>全局 打开声明 F3 &nbsp;</div><div>全局 打开外部javadoc Shift+F2 &nbsp;</div><div>全局 打开资源 Ctrl+Shift+R &nbsp;</div><div>全局 后退历史记录 Alt+← &nbsp;</div><div>全局 前进历史记录 Alt+→ &nbsp;</div><div>全局 上一个 Ctrl+, &nbsp;</div><div>全局 下一个 Ctrl+. &nbsp;</div><div>Java编辑器 显示大纲 Ctrl+O &nbsp;</div><div>全局 在层次结构中打开类型 Ctrl+Shift+H &nbsp;</div><div>全局 转至匹配的括号 Ctrl+Shift+P &nbsp;</div><div>全局 转至上一个编辑位置 Ctrl+Q &nbsp;</div><div>Java编辑器 转至上一个成员 Ctrl+Shift+↑ &nbsp;</div><div>Java编辑器 转至下一个成员 Ctrl+Shift+↓ &nbsp;</div><div>文本编辑器 转至行 Ctrl+L &nbsp;</div><div><br></div><div><br></div><div>搜索</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 出现在文件中 Ctrl+Shift+U &nbsp;</div><div>全局 打开搜索对话框 Ctrl+H &nbsp;</div><div>全局 工作区中的声明 Ctrl+G &nbsp;</div><div>全局 工作区中的引用 Ctrl+Shift+G &nbsp;</div><div><br></div><div><br></div><div>文本编辑</div><div>作用域 功能 快捷键 &nbsp;</div><div>文本编辑器 改写切换 Insert &nbsp;</div><div>文本编辑器 上滚行 Ctrl+↑ &nbsp;</div><div>文本编辑器 下滚行 Ctrl+↓ &nbsp;</div><div><br></div><div><br></div><div>文件</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 保存 Ctrl+X &nbsp;</div><div>Ctrl+S &nbsp;</div><div>全局 打印 Ctrl+P &nbsp;</div><div>全局 关闭 Ctrl+F4 &nbsp;</div><div>全局 全部保存 Ctrl+Shift+S &nbsp;</div><div>全局 全部关闭 Ctrl+Shift+F4 &nbsp;</div><div>全局 属性 Alt+Enter &nbsp;</div><div>全局 新建 Ctrl+N &nbsp;</div><div><br></div><div><br></div><div>项目</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 全部构建 Ctrl+B &nbsp;</div><div><br></div><div><br></div><div>源代码</div><div>作用域 功能 快捷键 &nbsp;</div><div>Java编辑器 格式化 Ctrl+Shift+F &nbsp;</div><div>Java编辑器 取消注释 Ctrl+\\ &nbsp;</div><div>Java编辑器 注释 Ctrl+/ &nbsp;</div><div>Java编辑器 添加导入 Ctrl+Shift+M &nbsp;</div><div>Java编辑器 组织导入 Ctrl+Shift+O &nbsp;</div><div>Java编辑器 使用try/catch块来包围 未设置，太常用了，所以在这里列出,建议自己设置。</div><div>也可以使用Ctrl+1自动修正。 &nbsp;</div><div><br></div><div><br></div><div>运行</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 单步返回 F7 &nbsp;</div><div>全局 单步跳过 F6 &nbsp;</div><div>全局 单步跳入 F5 &nbsp;</div><div>全局 单步跳入选择 Ctrl+F5 &nbsp;</div><div>全局 调试上次启动 F11 &nbsp;</div><div>全局 继续 F8 &nbsp;</div><div>全局 使用过滤器单步执行 Shift+F5 &nbsp;</div><div>全局 添加/去除断点 Ctrl+Shift+B &nbsp;</div><div>全局 显示 Ctrl+D &nbsp;</div><div>全局 运行上次启动 Ctrl+F11 &nbsp;</div><div>全局 运行至行 Ctrl+R &nbsp;</div><div>全局 执行 Ctrl+U &nbsp;</div><div><br></div><div><br></div><div>重构</div><div>作用域 功能 快捷键 &nbsp;</div><div>全局 撤销重构 Alt+Shift+Z &nbsp;</div><div>全局 抽取方法 Alt+Shift+M &nbsp;</div><div>全局 抽取局部变量 Alt+Shift+L &nbsp;</div><div>全局 内联 Alt+Shift+I &nbsp;</div><div>全局 移动 Alt+Shift+V &nbsp;</div><div>全局 重命名 Alt+Shift+R &nbsp;</div><div>全局 重做 Alt+Shift+Y&nbsp;</div><div><br></div>\n    ', '2014-05-14 03:07:42', '4.5', '9', '1');
INSERT INTO `psp_skill` VALUES ('4', '1', '46', '解决ubuntu不能用root运行chromium浏览器', '<div class=\"content-head clearfix\" style=\"zoom: 1; color: rgb(69, 69, 69); line-height: normal;\"><span style=\"background-color: rgb(249, 249, 249); line-height: 1.5;\"><b><font face=\"Arial Black\" size=\"5\"><i>用管理员用户登陆ubuntu运行chromium浏览器出现如下错误：</i></font></b></span></div><div id=\"content\" class=\"content mod-cs-content text-content clearfix\" style=\"width: 758px; overflow: hidden; font-size: 14px; line-height: 1.5; margin: 20px 0px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><p style=\"margin-bottom: 0px;\"></p><p style=\"margin-bottom: 0px;\"><img src=\"data:image/jpeg;base64,\"><br></p><p style=\"margin-bottom: 0px;\"><br></p><p style=\"margin-bottom: 0px;\"><strong><span style=\"text-decoration: underline;\">解决办法根据提示指定信息存储：--user-data-dir</span></strong></p><ol style=\"margin-bottom: 0px; margin-left: 35px; list-style-position: initial; list-style-image: initial;\"><li><p style=\"margin-bottom: 0px;\">用vi等文本编辑器编辑chromium浏览器的一个配置文件：/etc/chromium-browser/default</p></li><li><p style=\"margin-bottom: 0px;\">找到CHROMIUM_FLAGS=\"\"</p></li><li><p style=\"margin-bottom: 0px;\">改为：CHROMIUM_FLAGS=\"--user-data-dir\"&nbsp;</p></li></ol><p style=\"margin-bottom: 0px;\"><span style=\"color: rgb(255, 0, 0);\">也就是说在双引号里面加上错误提示的内容;user前面是两个下划线</span></p><p style=\"margin-bottom: 0px;\"><strong><span style=\"text-decoration: underline;\">更改后的结果如下图：马上就能运行</span></strong></p><p style=\"margin-bottom: 0px;\"><img src=\"data:image/jpeg;base64,\"><br></p></div>\n    ', '2014-05-14 03:31:10', '4.5', '37', '1');
INSERT INTO `psp_skill` VALUES ('5', '2', '48', 'oracle一些无聊的问题（个人总结）', '<p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\">1、oracledbconsoleorcl服务无法在本地启动：坚决断网即可，启动这样的服务需要本机ip和当时创建数据库时的ip一致才能启动；断网就没事了。</p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">2、oem无法把数据库添加到树（主要针对win7&amp;win8）:以管理员身份运行即可。<br style=\"padding: 0px; margin: 0px;\"><br style=\"padding: 0px; margin: 0px;\">3、在cmd中运行sqlplus命令时出现“SP2-1503: 无法初始化 Oracle 调用界面 SP2-1503: 无法初始化 Oracle” ：进入db_1/BIN目录找到sqlplus.exe:设置兼容性，勾选以管理员权限运行。<br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">4、oracle regexp_like貌似很强大。。<br style=\"padding: 0px; margin: 0px;\">暂时想起这些。。。<br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px;\"><br style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">-------------------------------------------------------------------------------------------------------------------</span><br style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; color: rgb(0, 112, 192); font-family: 微软雅黑, \'microsoft yahei\';\">解决 sqlplus 连接oracle时 出现&nbsp;</span></span></span><span style=\"padding: 0px; margin: 0px; color: rgb(0, 112, 192); font-family: 微软雅黑, \'microsoft yahei\';\">ORA-12560: TNS: 协议适配器错误</span><br style=\"padding: 0px; margin: 0px;\"></p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">原因</span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">1.监听服务没有启动。<br style=\"padding: 0px; margin: 0px;\">解决方案：win+r（Windows键+r键--〉快速打开 ”运行 “）--&gt;输入services.msc---&gt; 启动oracle....TNSlistener服务</span></p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">原因</span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">2.数据库实例服务（Oracleservice....）没有启动。(...代表你的数据库实例，默认为orcl，或者你自己的创建的数据库实例，xe版本的为XE)<br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">解决方案：win+r--&gt;输入services.msc---&gt; 启动</span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">Oracleservice....</span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">服务</span><br style=\"padding: 0px; margin: 0px;\"></p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><br style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">如果不是以上问题看下面：</span></p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">原因</span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">3.注册表问题。<br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">解决方案：win+r--&gt;输入regedit--〉找到HKEY_LOCAL_MACHINE\\SOFTWARE\\ORACLE\\KEY_ORACLEHOME...(XE版本为KEY_XE)<br style=\"padding: 0px; margin: 0px;\">-------&gt;双击ORACLE_SID----〉输入你的数据库实例名称。。</span></p><p style=\"margin-bottom: 0px; clear: both; height: auto; overflow: hidden; font-size: 14px; line-height: 21px; color: rgb(69, 69, 69); font-family: tahoma, helvetica, arial;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">或者在dos下面输入 &nbsp;</span><span style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">set oracle_sid=你的数据库实例（这个不太好使）<br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\"><br style=\"padding: 0px; margin: 0px;\"></span><span style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, \'microsoft yahei\';\">注：原因3一般由于原来创建了好多oracle数据库实例，之后由于各种原因导致自己创建的数据库实例不能用了（服务没有了，文件删除了等等），想连接原来默认的orcl，打开那个注册表的值应该是自己建的实例值。。<br style=\"padding: 0px; margin: 0px;\"><br style=\"padding: 0px; margin: 0px;\">还不好使的话，，断网 或者改ip为装oracle时的ip（所以装oracle建议不要开网络，以免导致不必要的麻烦。。）</span></span></span></span></p>\n    ', '2014-05-14 16:19:03', '4.5', '42', '1');
INSERT INTO `psp_skill` VALUES ('6', '2', '44', 'eclipse设置Tab键用空格代替：', '<div>eclipse设置Tab键用空格代替：<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">									</span></span>||</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">															</span></span></div><div>1、打开选项：General<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">										</span></span>||</div><div>&nbsp; -&gt; Editors -&gt; Text Editors<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">									</span></span>||<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">	</span></span></div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>||<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">		</span></span> <span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">			</span></span></div><div>在右侧找到Displayed tab width:<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">									</span></span>||</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>||</div><div>把下面的“Insert spaces for tabs” 勾选上，<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">							</span></span>||</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>||</div><div>点OK保存之后<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">											</span></span>||</div><div>&nbsp; <span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>||</div><div>2、针对java文件配置softtab<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">									</span></span>||</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>||</div><div>打开左侧菜单：Java -&gt; Code Style -&gt; Formatter，<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">							</span></span>||</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">												</span></span>|<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">					</span></span></div><div>然后点击Active profile中的Edit按钮，<span class=\"Apple-tab-span\" style=\"white-space:pre\"><span style=\"white-space: normal;\">								</span></span>#</div><div><br></div><div>选择General settings中的Tab policy为Spaces only，</div><div><br></div><div>然后右边选择 Edit...按钮，在General Settings页中 Tab policy 右边的下拉框，选择Space only!</div><div><br></div><div>然后下面的Indentation size 和 Tab size 都设置成你要的空格数即可！一般是4个空格！！</div><div>&nbsp;</div><div>修改Profile name然后保存即可。</div><div><br></div><div>--------------------------------------------------------------------------------------------------</div><div><br></div><div>配置Eclipse中的编辑器默认支持Unix模式的UTF-8格式文件编码</div><div>&nbsp;</div><div>打开菜单：General -&gt; Workspace，</div><div>&nbsp;&nbsp;</div><div>选择：Text file encoding为UTF-8，</div><div>&nbsp;&nbsp;</div><div>New</div><div>&nbsp; text file line delimiter为Unix，</div><div>&nbsp;</div><div>点OK保存即可。</div><div>&nbsp;&nbsp;</div><div><br></div>\n    ', '2014-05-17 04:04:00', '4.0', '6', '1');
INSERT INTO `psp_skill` VALUES ('7', '2', '48', 'jdbc连接数据库三种方法', '<div>方法一：</div><div>private String driver=\"oracle.jdbc.driver.OracleDriver\";</div><div>private String url=\"jdbc:oracle:thin:@wyc:1521:orcl\";</div><div>private String user=\"wyc\";</div><div>private String password=\"o123\";</div><div>private Connection conn =null;</div><div>Class.forName(driver);</div><div>conn=DriverManager.getConnection(url, user, password);</div><div>+————————————————————————————————————————————————————————————</div><div>String url=\"jdbc:oracle:thin@localhost:1521:orcl\";</div><div>String name=\"wyc\";</div><div>String password=\"o123\";</div><div>//-Djdbc.drivers=oracle.jdbc.driver.OracleDriver</div><div>//System.setProperty(\"jdbc.drivers\", driver);</div><div>//Class.forName(driver);</div><div>Connection conn= DriverManager.getConnection(url, name, password);</div><div>+————————————————————————————————————————————————————————————</div><div>String url=\"jdbc:oracle:thin@localhost:1521:orcl\";</div><div>String name=\"wyc\";</div><div>String password=\"o123\";</div><div>Driver d =new OracleDriver();</div><div>Connection conn= DriverManager.getConnection(url, name, password);</div>\n    ', '2014-05-17 04:05:10', '4.0', '15', '1');
