INSERT INTO `psp_skill` VALUES ('9', '2', '44', '给myeclipse中xml添加代码提示和关联源代码', '<p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">给xml添加提示功能：<span style=\"white-space: pre;\">\n</span>(添加xml的dtd 规则文件)</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">&lt;!DOCTYPE struts PUBLIC</span></p><span style=\"color: rgb(54, 46, 43); font-size: 14px; line-height: 26px; font-family: \'Microsoft YaHei\';\"><span style=\"white-space: pre;\"></span>\"-//Apache Software Foundation//DTD Struts Configuration 2.3//EN\"<br></span><span style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"></span><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\"><span style=\"white-space: pre;\"></span>\"http://struts.apache.org/dtds/struts-2.3.dtd\"&gt;</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\"><br></span></p><span style=\"color: rgb(54, 46, 43); font-size: 14px; line-height: 26px; font-family: \'Microsoft YaHei\';\">myeclipse首选项-》 搜索xml--》 XML catalog--》点击Add<br>在弹出的对话框中：<br>key 的地方输入类式上面的 第二行引号里面的完整内容-//Apache Software Foundation//DTD Struts Configuration 2.3//EN<br>location 找到对应的dtd文件<br></span><span style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"></span><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">上面的例子是struts2配置文件的xml</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">---------------------------------------------------------------------------------------------------------------------</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">myeclipse关联源码的方法：<span style=\"white-space: pre;\">\n</span></span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\">解决如下图 点击一个类或者接口 由于没有源码不给显示的问题</p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><img src=\"http://img.blog.csdn.net/20131010235639125?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvV0FOR3lhODIy/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast\" alt=\"\" style=\"border-style: none;\"><br></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><br></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">这里以关联struts2的源码为例子</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\">方法1<br>在需要关联源代码的包上点右键，选properties，弹出对话框。<br>选择java Source Attachment，单击external folder按钮，选择下载的struts源代码目录，目录为：\\struts-2.2.1.1\\src</span></p><p style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><span style=\"font-family: \'Microsoft YaHei\';\"><br>方法2<br>双击需要关联源代码的包中的一个类，在右边的编辑窗口中单击“Attach Source”按钮，弹出对话框<br>单击external folder按钮，选择下载的struts源代码目录，目录为：\\struts-2.2.1.1\\src</span></p>\n    ', '2014-05-21 00:24:19', '4.0', '2', '1');
INSERT INTO `psp_skill` VALUES ('10', '2', '43', 'eclipse编译jsp后的servlet路径', '<div class=\"content-head clearfix\" style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px;\"><h2 class=\"title content-title\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\">eclipse编译jsp后的servlet路径</h2></div><div id=\"content\" class=\"content mod-cs-content text-content clearfix\" style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255);\"><p><strong><span style=\"font-size: 18px;\">eclipse工作空间里面找（workspace）：&nbsp;&nbsp;&nbsp;.metadata\\.plugins\\org.eclipse.wst.server.core\\tmp2\\work\\Catalina\\localhost\\iim_proj\\\\org\\apache\\jsp\\下面就是</span></strong></p></div>\n    ', '2014-05-21 00:25:24', '0.0', '2', '1');
INSERT INTO `psp_skill` VALUES ('11', '1', '44', 'ORACLE解决登陆em状态暂挂方法1111', '<table style=\"color: rgb(54, 46, 43); font-family: Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255); width: 700px; table-layout: fixed;\"><tbody><tr><td><div id=\"blog_text\" class=\"cnt\"><p><span style=\"font-size: 24px;\"><font face=\"Courier New\">1、找到oracle安装目录中db_1/计算机名_orcl/sysman/config/emd.properties ，用记事本打开emd.properties，在emd.properties文件 最后一行 的agentTZRegion=GMT改为 agentTZRegion=Asia/Chungking（我在郑州，验证可用，其他地区未试）<br>2、在dos 窗口输入 emctl stop dbconsole 停止dbconsole服务（下同）<br>3、emctl config agent getTZ 使更改设置生效<br>4、emctl start dbconsole 启动dbconsole服务</font></span></p></div></td></tr></tbody></table>\n    ', '2014-05-21 01:32:13', '0.0', '3', '1');
